import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios"; // Import Axios for making API requests

export default function Navbar(props) {
  const [purchases, setPurchases] = useState([]);
  const apiUrl = "https://65127e22b8c6ce52b395b28b.mockapi.io/api/v1/your_endpoint";

  const fetchPurchases = async () => {
    try {
      const response = await axios.get(apiUrl);
      setPurchases(response.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchPurchases();
  }, []);

  return (
    <>
      {/* ... Your existing navbar code ... */}
      <div className="btn-group" role="group" aria-label="Basic example">
        <Link type="button" className="btn btn-primary" to="/" onClick={fetchPurchases}>
          Activities
        </Link>
        <Link type="button" className="btn btn-primary" to="/rewards">
          Rewards
        </Link>
      </div>

      {/* Display the purchases */}
      <div>
        <h2>Purchases:</h2>
        <ul>
          {purchases.map((purchase) => (
            <li key={purchase.id}>{purchase.description}</li>
            // Replace 'description' with the property you want to display
          ))}
        </ul>
      </div>
    </>
  );
}
